INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES (3423,2,'2020-06-30 18:13:22','2020-06-30 18:13:22','<p>[vc_row wrap_container=\"yes\"][vc_column][vc_empty_space][vc_row_inner equal_height=\"yes\" content_placement=\"middle\"][vc_column_inner width=\"7/12\"][vc_empty_space height=\"12px\"][vc_custom_heading text=\"About Me\" use_theme_fonts=\"yes\" show_border=\"yes\" border_skin=\"secondary\" border_size=\"sm\"][vc_empty_space height=\"12px\"][vc_column_text el_class=\"lead\"]I am a 54 year old part time student in a data science PhD program. I want to share the most effective educational support resources that I find useful. My goal is to connect with other life-long learners by offering helpful data science learning techniques.</p>\r\n<p>By joining our new platform, you will have the fantastic opportunity to learn the essence of both the theory and practice with plenty of hands-on exercises, real-world case studies and on-demand video lessons. All this is combined with the mentoring of the top data science experts who will guide you on the path of success. Build the skills you need to land your dream Data Science job today.[/vc_column_text][/vc_column_inner][vc_column_inner width=\"5/12\"][porto_image_frame boxshadow=\"yes\" image_id=\"3473\"][/porto_image_frame][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row el_id=\"history\"][vc_column][vc_custom_heading text=\"My Journey\" use_theme_fonts=\"yes\" show_border=\"yes\" border_skin=\"secondary\" border_size=\"sm\" el_class=\"m-t-xl\"][vc_row_inner][vc_column_inner width=\"7/12\"][vc_column_text]Prior to beginning with the ANU in 2020 Graham was <strong>Director of Data Science,</strong> Cloud and AI, Microsoft Asia, 2016-2020. Graham lead a team of data scientists and machine learning researchers delivering innovative and cutting edge AI and Machine Learning to the enterprise, and developing tomorrow’s advances in AI.</p>\r\n<p>Graham has a PhD in Machine Learning and is an Artificial Intelligence developer, researcher, practitioner, and educator as well as an Open Source Software developer, with over 30 years in the industry. He has authored many books and papers as well as a number of popular software packages including <a href=\"http://togaware.com/rattle/\">Rattle</a> for data mining. He is the author of the book <a href=\"https://bit.ly/rattle_data_mining\">Data Mining with Rattle and R: The Art of Excavating Knowledge from Data</a> published in 2011 and <a title=\"The Essentials of Data Science: Knowledge Discovery Using R (Chapman &amp; Hall/CRC The R Series) \" href=\"https://bit.ly/essentials_data_science\">The Essentials of Data Science: Knowledge Discovery Using R</a> published in 2017.[/vc_column_text][/vc_column_inner][vc_column_inner width=\"5/12\"][vc_column_text]</p>\r\n<ul class=\"list list-unstyled list-primary list-borders m-t-n\">\r\n<li class=\"m-t-none p-t p-b appear-animation\" data-appear-animation=\"fadeInUp\" data-appear-animation-delay=\"0\"><strong class=\"text-color-primary font-size-xl\">2016 - </strong> Moved to LA for research</li>\r\n<li class=\"m-t-none p-t p-b appear-animation\" data-appear-animation=\"fadeInUp\" data-appear-animation-delay=\"100\"><strong class=\"text-color-primary font-size-xl\">2014 - </strong>Completed graduation from university</li>\r\n<li class=\"m-t-none p-t p-b appear-animation\" data-appear-animation=\"fadeInUp\" data-appear-animation-delay=\"200\"><strong class=\"text-color-primary font-size-xl\">2006 - </strong>Got admission to university</li>\r\n<li class=\"m-t-none p-t p-b appear-animation\" data-appear-animation=\"fadeInUp\" data-appear-animation-delay=\"300\"><strong class=\"text-color-primary font-size-xl\">2003 - </strong> Inauguration of the new office</li>\r\n<li class=\"m-t-none p-t p-b appear-animation\" data-appear-animation=\"fadeInUp\" data-appear-animation-delay=\"400\"><strong class=\"text-color-primary font-size-xl\">2001 - </strong> Started journey as data science</li>\r\n</ul>\r\n<p>[/vc_column_text][/vc_column_inner][/vc_row_inner][vc_separator color=\"custom\" style=\"solid\" gap=\"tall\" accent_color=\"#dbdbdb\" el_class=\"m-b-none\"][/vc_column][/vc_row][vc_row el_id=\"mission-vision\"][vc_column][vc_row_inner][vc_column_inner width=\"1/2\" animation_type=\"fadeInUp\"][bsf-info-box icon=\"Simple-Line-Icons-target\" icon_size=\"40\" icon_color=\"#e04622\" title=\"Mission\" pos=\"top\" el_class=\"m-t-xxl\" title_font=\"font_family:Open Sans|font_call:Open+Sans|variant:300\" title_font_style=\"font-weight:300;\" title_font_size=\"desktop:30px;\" title_font_color=\"#2e353e\"]Lorem ipsum dolor sit amet, consectetur adipiscing metus elit. Quisque rutrum pellentesque imperdiet.[/bsf-info-box][/vc_column_inner][vc_column_inner width=\"1/2\" animation_delay=\"300\" animation_type=\"fadeInUp\"][bsf-info-box icon=\"Simple-Line-Icons-eye\" icon_size=\"40\" icon_color=\"#e04622\" title=\"Vision\" pos=\"top\" el_class=\"m-t-xxl\" title_font=\"font_family:Open Sans|font_call:Open+Sans|variant:300\" title_font_style=\"font-weight:300;\" title_font_size=\"desktop:30px;\" title_font_color=\"#2e353e\"]Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque rutrum pellentesque imperdiet. Nulla lacinia iaculis nulla nisi elit consequat.[/bsf-info-box][/vc_column_inner][/vc_row_inner][vc_separator color=\"custom\" style=\"solid\" gap=\"taller\" accent_color=\"#dbdbdb\" el_class=\"m-b-none\"][/vc_column][/vc_row]</p>\r\n','About','','inherit','closed','closed','','24-autosave-v1','','','2020-06-30 18:13:22','2020-06-30 18:13:22','',24,'https://learndsl.com/24-autosave-v1/',0,'revision','',0);
