INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES (3784,2,'2021-03-28 12:11:06','2021-03-28 16:11:06','Terminology surrounding typography has morphed and found its place in our modern day vernacular. The terms \"typeface\" and \"font\" are used interchangeably today, but how did we get there? Have you ever wondered if a font is the same thing as a typeface? Or is typeface just a term that historians and academics use? Maybe\n— Read on <a href=\"https://hobancards.com/blogs/thoughts-and-curiosities/difference-between-font-and-typeface\">hobancards.com/blogs/thoughts-and-curiosities/difference-between-font-and-typeface</a>','The Difference Between Font and Typeface – Hoban Cards','','publish','closed','open','','the-difference-between-font-and-typeface-hoban-cards','','','2021-03-28 12:11:06','2021-03-28 16:11:06','Terminology surrounding typography has morphed and found its place in our modern day vernacular. The terms \"typeface\" and \"font\" are used interchangeably today, but how did we get there? Have you ever wondered if a font is the same thing as a typeface? Or is typeface just a term that historians and academics use? Maybe\n— Read on <a href=\"https://hobancards.com/blogs/thoughts-and-curiosities/difference-between-font-and-typeface\">hobancards.com/blogs/thoughts-and-curiosities/difference-between-font-and-typeface</a>',0,'https://learndsl.com/the-difference-between-font-and-typeface-hoban-cards/',0,'post','',0);
